      view: new OlView({
        center: this.state.center,
        zoom: this.state.zoom
      }),
      // interactions: 
  })

  componentDidMount() {
    this.olmap.setTarget("map");
  }

  updateMap = (feature:Feature)=>{
    var styles = [];
